import React from 'react';
import Navbar from 'react-bootstrap/Navbar'

const TopBar = () => {
    const topBarStyle ={
        top:0,
        left: '7rem',
        height: '50px',
        width: "100%",
        backgroundColor: '#3250a2',
        color: 'white',
        justifyContent: 'center',
        alignContent: 'center',
        display: 'flex',
        padding: 5
    }
    return (
        <div style={topBarStyle}>
            <h2>Maisonette Customer Care</h2>
        </div>
    )
}

export default TopBar;
